import React, {Component} from 'react';
import {NavLink} from "react-router-dom";


class Mynavigation extends Component {
    render() {
        return (
            <div>
                <ul>


                    <li><NavLink activeStyle={{color: "darkgreen"}} to="/">Home</NavLink></li>
                    <li><NavLink activeStyle={{color: "darkgreen"}} to="/page1">Page1</NavLink></li>
                    <li><NavLink activeStyle={{color: "darkgreen"}} to="/page2">Page2</NavLink></li>
                    <li><NavLink activeStyle={{color: "darkgreen"}} to="/page3">Page3</NavLink></li>


                </ul>
            </div>
        );
    }
}

export default Mynavigation;
